import React, { useState } from 'react'
import { Form, StepTitle } from 'semantic-ui-react'

class FormExampleSubcomponentControl extends Component {
  state = {}

  handleChange = (e, { value }) => this.setState({ value })

  render() {
    const { value } = this.state

    const [name, setName] = useState("");
    const [email,setEmail] = useState("");
    const [pass,setPass] = useState("");


    return (
      <Form>
        <Form.Input fluid label='Company Name' placeholder='Name' value={name} onChange={e => SetTitle(e.target.value)}/>
        <Form.Input fluid label='Company Email' placeholder='Email' value={email} onChange={e => SetEmail(e.target.value)}/>
        <Form.Input fluid label='Enter Password' type='password' value={pass} onChange={e => SetPass(e.target.value)}/>
        <Form.Button>Submit</Form.Button>
      </Form>
    )
  }
}

export default FormExampleSubcomponentControl
